import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Login from "./components/Login"; // Ensure Login is correctly imported

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} />  {/* Ensure this is pointing to Login */}
      </Routes>
    </Router>
  );
}

export default App;
